import React from 'react'
// import Card from '../Components/Card'
import Aboutcard from './Aboutcard'
const games = [
1 ,2 ,3,4,5,6,7,8,9
]
export default function FeedCont() {
  return (
    <div className='feed-cont'>
        {
        
          games.map((e)=>{
            return <Card game = {games[e]}> </Card>
          })
        }
    </div>
  )
}
